import React from "react";

const Navbar=()=>{
    return(
        <>
        <div className="navbarr " >
    <div className="nav-1">
        <h1>Rishav <strong className="caste">Sachdeva</strong></h1>
    </div>
    <div>
        <ul  className="nav-2">
            <NavLink className="nav-elements"  exact to="/about">About Me</NavLink>
            <NavLink className="nav-elements" exact to='/certificates'>Certifications</NavLink>
            <NavLink className="nav-elements" exact to='/education'>Education</NavLink>
            <NavLink className="nav-elements" exact to='/skills'>Skills</NavLink>
            <NavLink className="nav-elements" exact to='/contact'>Contact Me</NavLink>
        </ul>
    </div>
</div>
        
        </>
    );
}
export default Navbar;
